import { Heading,Box } from "@chakra-ui/react";
import { motion } from "framer-motion";

const Slide = () => {
  return (
    <motion.div
      initial={{ opacity: 0 }}
      animate={{ opacity: 1 }}
      transition={{ duration: 20 }}
    >
      <Box pos="fixed" top="200" left="30" p={5}>
        <Heading size="md">Novel Cloud Storage  Approach</Heading>
      </Box>
    </motion.div>
  );
};

export default Slide;
